const Card = ({ title, image, artist, reviewer }) => {

    //https://i1.sndcdn.com/artworks-2f4b52e3-85c5-4b6f-bda5-e569ec01ce9b-0-t500x500.jpg

    return (
        <div className="card">
            <img src={image} />
            <div className="card-details">
                <h2 className="gold">{title}</h2>
                <h4 className="tan">{artist}</h4>
                <p className="beige">reviewed by {reviewer}</p>
            </div>
        </div>
    );
}

export default Card;
